import React from "react";
import './about.scss';

const About = () => {
    return (
        <div className="about">
            <div>
                <div className='profile'>
                    <img id='icon1' src={require('../../assets/about/profile1.png')} />
                    <img id='icon2' src={require('../../assets/about/profile2.png')} />
                </div>
                <div>
                    <h2>Soomin Chung</h2>
                </div>
            </div>
            <p className="intro">
                Hello! I'm Soomin, a designer based in Chicago. 
                <br/><br/>
                I'm currently a senior student in the School of Art Institute of Chicago, 
                <br/><br/>
                In my free time, I enjoy, and brewing coffee.
            </p>
        </div>
    );
};

export default About;
